import React from 'react';
import Grid from '@mui/material/Grid';
import Section from "../Section";
import rogue from "../../pictures/Rogue.jpeg";
import cc from "../../pictures/CrookedCan.png";
import cdme from "../../pictures/CDME.jpeg";
import "../../styles/Experience.css";

function Experience() {
  return (
    <Grid container direction="column" justifyContent="space-evenly" spacing={0}>
        <Grid item>
            <Section
                title="Rogue Fitness"
                subtitle="Product Design Engineer"
                img={rogue}
                alt="Rogue Fitness"
                imgBorderRadius="10px"
                imgWidth="0.8"
                infoList={[
                        ["THIS IS A TEST", "it's a gpa."],
                        ["Outline of Program", "the program is of such information and learning."],
                        ["Class Highlights", "classes i've taken are of such variety"]
                ]}
            />
        </Grid>
        <Grid item>
            <Section
                title="Crooked Can"
                subtitle="Bartender"
                img={cc}
                alt="Crooked Can"
                imgWidth="0.4"
                infoList={[
                        ["THIS IS A TEST", "it's a gpa."],
                        ["Outline of Program", "the program is of such information and learning."],
                        ["Class Highlights", "classes i've taken are of such variety"]
                ]}
            />  
        </Grid>
        <Grid item>
            <Section
                title="Center for Design and Manufacturing Excellence"
                subtitle="Undergraduate Engineering Assistant"
                img={cdme}
                alt="CDME"
                imgBorderRadius="10px"
                infoList={[
                        ["THIS IS A TEST", "it's a gpa."],
                        ["Outline of Program", "the program is of such information and learning."],
                        ["Class Highlights", "classes i've taken are of such variety"]
                ]}
            />  
        </Grid>
    </Grid>
  );
}

export default Experience;
